import { useState } from 'react'

export default function Navbar()
 {                                                      
  const [showInfo , setShowInfo] = useState(false)
                      
  const [showMenu , setShowMenu] = useState(false)
  
  
  const clickHandler = () => {
    setShowInfo(!showInfo)
  }
  
  const menuHandler = () => {
    setShowMenu(!showMenu)
  }
   return(
   <><div className="port">
       <nav className="navbar-nav">
         <h2 className="port">PortFolio</h2>
         <a className="nav-link active" aria-current="page" href="/">Home</a>
         <a className="nav-link" href="/projects">Projects</a>
         <a className="nav-link" href="/resume">Resume</a>
         <button className="button" onClick={clickHandler}>Contact</button>

       </nav>
       {showInfo && (<div className="info">
         <p className="contact-no">Contact-No: 0331-0211003</p>
         <p className="email">Email: takhleesfatima2003@gmail.com</p>
         <p className="id">LinkedIn: Id</p>
       </div>)}
     </div>
    
       </>

   )

   }
